pragma solidity ^0.8.30;

contract Enum{

    enum Status {
        Aberto, Fechado, Progresso
    }

    Status public status;

    constructor(){
        status = Status.Aberto;   
    }

    function continar () public view {
        require(status == Status.Aberto, unicode"Não pode entrar");
    }

}
